    18,nt"tags": [],nt"title": "Dissolved inorganic carbon, alkalinity, temperature,
    salinity and other variables collected from discrete sample and profile observations
    using CTD, bottle and other instruments from the USCGC POLAR SEA in the North Greenland
    Sea from 1992-07-15 to 1992-08-14 (NODC Accession 0115687)",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-27T03:16:07.008884",nt"name": "dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-dc2704",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0115687 includes biological,
    chemical, discrete sample, physical and profile data collected from USCGC POLAR
    SEA in the North Greenland Sea from 1992-07-15 to 1992-08-14 and retrieved during
    cruise CARINA/32L919920715 and NEWP92. These data include ALKALINITY, AMMONIUM,
    BACTERIA - BACTERIAL DENSITY, CHLOROPHYLL A, DELTA HELIUM-3, DISSOLVED INORGANIC
    CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PARTICULATE
    ORGANIC CARBON, PARTICULATE ORGANIC NITROGEN, PHAEOPHYTIN, PHOSPHATE, Potential
    temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen isotope) and WATER TEMPERATURE.
    The instruments used to collect these data include CTD and bottle. These data were
    collected by J. Deming of University of Washington as part of the CARINA/32L919920715
    data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
    is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
    It has produced a merged internally consistent data set of open ocean subsurface
    measurements for biogeochemical investigations, in particular, studies involving
    the carbon system. The original focus area was the North Atlantic Ocean, but over
